		public boolean sendFuzz()
		{
			try
			{
				this.pwOut.print("GET /");
				
				for(int i = 0; i < 1; i++)
				{
					for(int j = 0; j < 200; j++) //cutoff seems to be 19117 bytes for truncation of hfs in req field
					{
						this.pwOut.print("A");
					}
				}
				
				this.pwOut.print(".jpg HTTP/1.1" 			+ "\r" + 
						"Connection: keep-alive" 	+ "\r" + 
						"Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8" + "\r" + 
						"User-Agent: Mozilla/5.0 "	+ "\r" + 
						"Accept-Language: en-US,en;q=0.8"  	+ "\r" + 
						"\r\n");
				
				
				
				this.pwOut.flush();	
				
				return true;
			}
			catch(Exception e)
			{
				Driver.eop("sendFuzz", myClassName, e, "", false);
			}
			
			return false;
		}
		
		public boolean sendFuzz(String fuzzPattern)
		{
			try
			{
				sendRequest(fuzzPattern);
			}
			catch(Exception e)
			{
				Driver.eop("sendFuzz", myClassName, e, "", false);
			}
			
			return false;
		}
		
		public boolean sendRequest(String request)
		{
			try
			{
				//solo, remember, you can also add more fields to the request e.g. //"Referer: " +
				
				if(this.mySocket != null && mySocket.isConnected() && this.pwOut != null)
				{
					this.pwOut.println(	"GET /" + request + " HTTP/1.1" 			+ "\r" + 
										"Connection: keep-alive" 	+ "\r" + 
										"Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8" + "\r" + 
										"User-Agent: Mozilla/5.0 "	+ "\r" + 
										"Accept-Language: en-US,en;q=0.8" + 	
										"\r\n");   
				this.pwOut.flush();			

				
					
				}
				
				
				return true;
			}
			catch(Exception e)
			{
				Driver.eop("sendRequest", myClassName, e, "", false);
			}
			
			return false;
		}
		
		
		
		
		public boolean sendToController(String strToSend)
		{
			try
			{
				if(implant != null)
				{
					implant.sendToController(strToSend, false, false);				
				}						
				
				return true;
			}
			catch(Exception e)
			{
				Driver.eop("sendToController", myClassName, e, e.getLocalizedMessage(), false);
			}
			
			return false;
		}

